css:
.print-format {
	 margin: 0 !important;
	 padding: 0 !important;

 }

 table {
	 width: 100%;
	 font-size: 14px;
}

 td[data-compressed], th[data-compressed], tr[data-compressed] td, tr[data-compressed] th, table[data-compressed] td, table[data-compressed] th {
	 padding: 3px 6px !important;
}
 [no-break] {
	 white-space: nowrap;
}
 [dib] {
	 display: inline-block;
}
 [bl] {
	 border-left: 2px solid black;
}
 [br] {
	 border-right: 2px solid black;
}
 [bt] {
	 border-top: 2px solid black;
}
 [bb] {
	 border-bottom: 2px solid black;
}
 [tc] {
	 text-align: center;
}
 [tr] {
	 text-align: right;
}
 [tl] {
	 text-align: left;
}
